//     if (isError) {
//       navigate("/");
//     }
//     // if(user && user.role !== "admin"){
//     //   navigate("/dashboard");
//     // }
//     // opcja dostÄ™pu inny niz admin do dashboard
//   }, [isError,
//     //user,
    
//     navigate]);
return (
    <div>
      <div className="div-table"> 
      <table className="employee-table"> 
        <thead>
          <tr className="employee-tr">
            <th>Imie Nazwisko</th>
            <th>Stanowisko</th>
            <th>OddziaÅ‚</th>
            <th>Email</th>
            <th>DoÅ›wiadczenie</th>
            <th className="employee-setting">Opcje</th>
          </tr>
        </thead>
        <tbody>
          {user.map((user, index) => (
            <tr key={user.uuid} className="employee-tr">
              {/* <td className="td-employee"> {index + 1} </td> */}
              <td className="employee-profile td-employee">     
              { user.sex == "Kobieta"?
                <div className='circle-avatar-women'>{user && `${user.name.charAt(0).toUpperCase()}${user.surname.charAt(0).toUpperCase()}`}</div> 
               :
                <div className='circle-avatar-man'>{user && `${user.name.charAt(0).toUpperCase()}${user.surname.charAt(0).toUpperCase()}`}</div> 
               }
              {user && `${user.name} ${user.surname}`}</td>
              <td className="td-employee">{user.position} {user.role}</td>
              <td className="td-employee">MnikÃ³w</td>
              <td className="td-employee">{user.email}</td>
              <td className="td-employee">1rok</td>
              <td className="td-employee employee-setting">
               <SettingThreeIcon/>
                <div className="under-employee-pop">
                <Link
                  to={`/users/edit/${user.uuid}`}
                  className="button is-small is-info"
                >
                  Edit
                </Link>
                <button
                  onClick={() => deleteUser(user.uuid)}
                  className="button is-small is-danger"
                >
                  Delete
                </button>
                </div>
                
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      </div> 
    </div>
  );
};

export default TableEmployee;
